import base64
import unittest
from io import BytesIO

import numpy as np

from services.credentials import read_table
from services.files import file_service


class MyTestCase(unittest.TestCase):
    files = [
        ''
        '']

    def get_lists(self, url):
        google_doc = read_table(url)
        worksheets = google_doc[0].worksheets()
        lists = []
        for ws in worksheets:
            lists.append(ws.title)

        return lists

    def clean_zeros(self, a):
        if a == 0:
            a = ''
        else:
            a = int(a)
        return a

    def test_something(self):

        js = {
            "url": "https://docs.google.com/spreadsheets/d/1vC2Pt9sQWvU8GEQD6xqcaLbdKsd7YESiqF9PwapZUb0/edit#gid=1198610154",
            "filters": [
                {
                    "filter": "Отпуск основной",
                    "column": "I"
                },
                {
                    "filter": "Болезнь",
                    "column": "F"
                },
                {
                    "filter": "Отпуск по уходу за ребенком",
                    "column": "G"
                },
            ]
        }

        table = read_table(
            'https://docs.google.com/spreadsheets/d/1vC2Pt9sQWvU8GEQD6xqcaLbdKsd7YESiqF9PwapZUb0/edit#gid=1198610154',
            'list2')
        google_doc = table[1]

        cols = file_service.find_filters(js)
        ranges = file_service.find_doc_range(google_doc, js)
        aggregated_result = []

        for f in self.files:
            t = BytesIO(base64.b64decode(f))
            body = file_service.count_days(google_doc, file_service.get_data_from_file(t), cols)
            aggregated_result += [body]

        aggregated_result = np.array(aggregated_result)

        result = np.zeros(shape=(len(aggregated_result[0]), len(aggregated_result[0][0])))

        for k, v in enumerate(aggregated_result):
            for i in range(len(result)):
                result[i] = np.sum([result[i], v[i]], axis=0)

        result = np.transpose(result)

        result = [[self.clean_zeros(val) for val in sublist] for sublist in result]

        google_doc.update(ranges, result)


if __name__ == '__main__':
    unittest.main()
